import './App.css';
import Registration from './Registration';
import Login from './Login';
import theme from "./theme";
import { ThemeProvider } from '@emotion/react';
import CssBaseline from '@mui/material/CssBaseline';
import ResponsiveAppBar from './components/appbar.js';
import Anasayfa from "./pages/Anasayfa.js"

const express = require('express');
const cors = require('cors');
const app = express();

app.use(cors());

// Diğer middleware ve route tanımlamalarınızı ekleyin

app.listen(3000, () => {
  console.log('Server is running on port 3000');
});
const corsOptions = {
  origin: 'http://localhost:3000',
  methods: 'GET,HEAD,PUT,PATCH,POST,DELETE',
  credentials: true,  // Bu, gerekirse çerezlerinizi paylaşmanıza olanak tanır
};

app.use(cors(corsOptions));


function App() {
  return (

    <ThemeProvider theme={theme}>
      <CssBaseline />
    <div className="App">
    <Anasayfa/>

    </div>
    </ThemeProvider>
  );
}

export default App;
